import React, { useEffect, useRef, useState } from 'react';
import { gsap } from 'gsap';
import { ScrollTrigger } from 'gsap/ScrollTrigger';

const Contact = () => {
  const sectionRef = useRef(null);
  const phoneRef = useRef(null);
  const [activeApp, setActiveApp] = useState('contacts');
  const [currentTime, setCurrentTime] = useState(new Date());
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    message: '',
    interest: 'general'
  });

  // Phone apps data
  const apps = [
    { id: 'contacts', name: 'CONTACTS', icon: '📞', color: 'neon-green' },
    { id: 'messages', name: 'MESSAGES', icon: '💬', color: 'neon-blue' },
    { id: 'location', name: 'LOCATION', icon: '📍', color: 'gta-red' },
    { id: 'social', name: 'SOCIAL', icon: '📱', color: 'neon-pink' }
  ];

  const contactMethods = [
    { type: 'Call HQ', number: '+1 (555) SAE-AUTO', icon: '📞', action: 'call' },
    { type: 'Text Crew', number: '+1 (555) SAE-TEXT', icon: '💬', action: 'text' },
    { type: 'Emergency Line', number: '+1 (555) SAE-HELP', icon: '🚨', action: 'emergency' }
  ];

  const socialLinks = [
    { platform: 'Instagram', handle: '@sae_auto_empire', icon: '📸', color: 'text-pink-400' },
    { platform: 'Discord', handle: 'SAE Gaming Lobby', icon: '🎮', color: 'text-purple-400' },
    { platform: 'YouTube', handle: 'SAE Garage Builds', icon: '📺', color: 'text-red-400' },
    { platform: 'TikTok', handle: '@sae_street_builds', icon: '🎵', color: 'text-cyan-400' }
  ];

  useEffect(() => {
    const section = sectionRef.current;
    const phone = phoneRef.current;

    // Time updater
    const timeInterval = setInterval(() => {
      setCurrentTime(new Date());
    }, 1000);

    // Phone entrance animation
    gsap.fromTo(phone, 
      { opacity: 0, y: 100, rotateX: -30 },
      {
        opacity: 1,
        y: 0,
        rotateX: 0,
        duration: 1.2,
        ease: "power3.out",
        scrollTrigger: {
          trigger: section,
          start: "top 80%",
          end: "top 50%",
          toggleActions: "play none none reverse"
        }
      }
    );

    return () => {
      clearInterval(timeInterval);
    };
  }, []);

  const handleInputChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Add submission animation
    gsap.to(phoneRef.current, {
      scale: 0.98,
      duration: 0.1,
      yoyo: true,
      repeat: 1,
      ease: "power2.inOut"
    });

    console.log('Form submitted:', formData);
    // In a real app, this would send the message
  };

  const ContactsApp = () => (
    <div className="space-y-4">
      <h3 className="font-gta text-lg neon-green mb-4 text-center">SAE HEADQUARTERS</h3>

      {contactMethods.map((contact, index) => (
        <div key={index} className="bg-gray-800 rounded-lg p-4 hover:bg-gray-700 transition-colors cursor-pointer">
          <div className="flex items-center space-x-4">
            <div className="text-2xl">{contact.icon}</div>
            <div>
              <div className="font-street text-white font-bold">{contact.type}</div>
              <div className="font-street text-gta-yellow text-sm">{contact.number}</div>
            </div>
          </div>
        </div>
      ))}

      <div className="bg-gradient-to-r from-gta-black to-gray-800 rounded-lg p-4 border border-neon-green">
        <h4 className="font-street text-neon-green text-sm uppercase mb-2">Location</h4>
        <p className="font-street text-white text-sm">
          SAE Garage Complex<br />
          123 Speed Street<br />
          Auto City, AC 90210
        </p>
      </div>
    </div>
  );

  const MessagesApp = () => (
    <div className="space-y-4">
      <h3 className="font-gta text-lg neon-blue mb-4 text-center">SEND MESSAGE</h3>

      <form onSubmit={handleSubmit} className="space-y-4">
        <div>
          <input
            type="text"
            name="name"
            placeholder="Your Name"
            value={formData.name}
            onChange={handleInputChange}
            className="w-full bg-gray-800 border border-gray-600 rounded px-4 py-3 text-white font-street focus:border-neon-blue focus:outline-none"
            required
          />
        </div>

        <div>
          <input
            type="email"
            name="email"
            placeholder="Email Address"
            value={formData.email}
            onChange={handleInputChange}
            className="w-full bg-gray-800 border border-gray-600 rounded px-4 py-3 text-white font-street focus:border-neon-blue focus:outline-none"
            required
          />
        </div>

        <div>
          <select
            name="interest"
            value={formData.interest}
            onChange={handleInputChange}
            className="w-full bg-gray-800 border border-gray-600 rounded px-4 py-3 text-white font-street focus:border-neon-blue focus:outline-none"
          >
            <option value="general">General Inquiry</option>
            <option value="membership">Join the Crew</option>
            <option value="events">Event Information</option>
            <option value="sponsorship">Sponsorship</option>
            <option value="technical">Technical Support</option>
          </select>
        </div>

        <div>
          <textarea
            name="message"
            placeholder="Your message to the crew..."
            value={formData.message}
            onChange={handleInputChange}
            rows="4"
            className="w-full bg-gray-800 border border-gray-600 rounded px-4 py-3 text-white font-street focus:border-neon-blue focus:outline-none resize-none"
            required
          />
        </div>

        <button
          type="submit"
          className="w-full bg-gradient-to-r from-neon-blue to-gta-blue text-white font-street py-3 rounded hover:from-gta-blue hover:to-neon-blue transition-all duration-300"
        >
          SEND MESSAGE
        </button>
      </form>
    </div>
  );

  const LocationApp = () => (
    <div className="space-y-4">
      <h3 className="font-gta text-lg text-gta-red mb-4 text-center">FIND US</h3>

      {/* Mock mini-map */}
      <div className="bg-gray-800 rounded-lg p-4 h-40 relative overflow-hidden">
        <div className="absolute inset-0 bg-gradient-to-br from-gray-700 to-gray-900"></div>
        <div className="absolute top-4 left-4 w-16 h-12 bg-gray-600 rounded"></div>
        <div className="absolute top-8 right-6 w-20 h-8 bg-gray-600 rounded"></div>
        <div className="absolute bottom-6 left-8 w-12 h-16 bg-gray-600 rounded"></div>
        <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2">
          <div className="w-4 h-4 bg-gta-red rounded-full animate-ping"></div>
          <div className="w-2 h-2 bg-white rounded-full absolute top-1 left-1"></div>
        </div>
        <div className="absolute bottom-2 right-2 text-xs text-gray-400 font-street">SAE HQ</div>
      </div>

      <div className="space-y-3">
        <div className="bg-gray-800 rounded p-3">
          <div className="font-street text-gta-yellow text-sm">Address</div>
          <div className="font-street text-white text-sm">123 Speed Street, Auto City</div>
        </div>
        <div className="bg-gray-800 rounded p-3">
          <div className="font-street text-gta-yellow text-sm">Hours</div>
          <div className="font-street text-white text-sm">Mon-Fri: 6PM-12AM | Weekends: 12PM-2AM</div>
        </div>
        <div className="bg-gray-800 rounded p-3">
          <div className="font-street text-gta-yellow text-sm">Parking</div>
          <div className="font-street text-white text-sm">Free garage parking available</div>
        </div>
      </div>
    </div>
  );

  const SocialApp = () => (
    <div className="space-y-4">
      <h3 className="font-gta text-lg neon-pink mb-4 text-center">SOCIAL NETWORK</h3>

      {socialLinks.map((social, index) => (
        <div key={index} className="bg-gray-800 rounded-lg p-4 hover:bg-gray-700 transition-colors cursor-pointer">
          <div className="flex items-center justify-between">
            <div className="flex items-center space-x-4">
              <div className="text-2xl">{social.icon}</div>
              <div>
                <div className={`font-street font-bold ${social.color}`}>{social.platform}</div>
                <div className="font-street text-gray-300 text-sm">{social.handle}</div>
              </div>
            </div>
            <div className="text-neon-green">→</div>
          </div>
        </div>
      ))}

      <div className="bg-gradient-to-r from-gta-black to-gray-800 rounded-lg p-4 border border-neon-pink">
        <h4 className="font-street text-neon-pink text-sm uppercase mb-2">Join Our Community</h4>
        <p className="font-street text-white text-sm leading-relaxed">
          Connect with fellow automotive enthusiasts, share your builds, and stay updated on the latest SAE events and tech.
        </p>
      </div>
    </div>
  );

  const renderApp = () => {
    switch (activeApp) {
      case 'contacts': return <ContactsApp />;
      case 'messages': return <MessagesApp />;
      case 'location': return <LocationApp />;
      case 'social': return <SocialApp />;
      default: return <ContactsApp />;
    }
  };

  return (
    <section 
      id="contact"
      ref={sectionRef}
      className="min-h-screen py-20 bg-gradient-to-br from-gta-black via-gray-900 to-gta-black relative overflow-hidden flex items-center justify-center"
    >
      {/* Background effects */}
      <div className="absolute inset-0 bg-grid opacity-5"></div>

      {/* Phone UI */}
      <div 
        ref={phoneRef}
        className="relative max-w-sm mx-auto"
      >
        {/* Phone frame */}
        <div className="bg-gray-900 rounded-3xl p-2 shadow-2xl border-4 border-gray-700">
          {/* Phone screen */}
          <div className="bg-black rounded-2xl overflow-hidden">
            {/* Status bar */}
            <div className="bg-gray-900 px-4 py-2 flex justify-between items-center">
              <div className="flex items-center space-x-1">
                <div className="w-1 h-1 bg-neon-green rounded-full animate-pulse"></div>
                <div className="w-1 h-1 bg-neon-green rounded-full animate-pulse"></div>
                <div className="w-1 h-1 bg-neon-green rounded-full animate-pulse"></div>
                <span className="font-street text-xs text-neon-green ml-2">SAE Network</span>
              </div>
              <div className="font-street text-xs text-white">
                {currentTime.toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' })}
              </div>
              <div className="flex items-center space-x-1">
                <div className="w-4 h-2 border border-white rounded-sm">
                  <div className="w-full h-full bg-neon-green rounded-sm"></div>
                </div>
              </div>
            </div>

            {/* App header */}
            <div className="bg-gradient-to-r from-gta-black to-gray-800 px-4 py-3 border-b border-gray-700">
              <h2 className="font-gta text-xl neon-text text-center">SAE AUTO EMPIRE</h2>
              <p className="font-street text-gta-yellow text-center text-sm">Communication Hub</p>
            </div>

            {/* App navigation */}
            <div className="bg-gray-800 px-2 py-2">
              <div className="grid grid-cols-4 gap-1">
                {apps.map((app) => (
                  <button
                    key={app.id}
                    onClick={() => setActiveApp(app.id)}
                    className={`p-3 rounded-lg transition-all duration-300 ${
                      activeApp === app.id 
                        ? 'bg-gray-700 scale-95' 
                        : 'bg-gray-900 hover:bg-gray-700'
                    }`}
                  >
                    <div className="text-center">
                      <div className="text-xl mb-1">{app.icon}</div>
                      <div className={`font-street text-xs ${activeApp === app.id ? app.color : 'text-gray-400'}`}>
                        {app.name}
                      </div>
                    </div>
                  </button>
                ))}
              </div>
            </div>

            {/* App content */}
            <div className="bg-gta-black min-h-96 p-4">
              {renderApp()}
            </div>

            {/* Home indicator */}
            <div className="bg-gray-900 py-2 flex justify-center">
              <div className="w-12 h-1 bg-gray-600 rounded-full"></div>
            </div>
          </div>
        </div>

        {/* Phone reflection */}
        <div className="absolute inset-0 bg-gradient-to-t from-transparent via-transparent to-white opacity-10 rounded-3xl pointer-events-none"></div>
      </div>

      {/* Section info */}
      <div className="absolute top-20 left-1/2 transform -translate-x-1/2 text-center">
        <h2 className="gta-title text-4xl md:text-6xl neon-text mb-4">
          CONTACT HQ
        </h2>
        <p className="font-street text-gta-yellow text-lg max-w-md">
          Use the SAE communication device to reach our crew
        </p>
      </div>

      {/* Floating particles */}
      <div className="absolute inset-0 pointer-events-none overflow-hidden">
        <div className="absolute top-1/4 left-16 w-2 h-2 bg-neon-green rounded-full animate-ping opacity-30"></div>
        <div className="absolute bottom-1/3 right-24 w-1.5 h-1.5 bg-neon-pink rounded-full animate-bounce opacity-40"></div>
        <div className="absolute top-2/3 left-1/4 w-1 h-1 bg-gta-yellow rounded-full animate-pulse opacity-50"></div>
      </div>
    </section>
  );
};

export default Contact;
